import React, { useEffect, useState } from 'react';
import { supabase } from '../supabaseClient';
import { ShoppingBag, ChevronRight, User, CreditCard, Package, MessageCircle } from 'lucide-react';
import { Link } from 'react-router-dom';

// 1. UPDATED COLOR CONSTANTS
const BRAND_BLUE = '#008ECC'; // Your Light Blue
const LIGHT_BG = '#F5F7F9';

const HomePage = ({ addToCart }) => {
  const [products, setProducts] = useState([]);
  const [loading, setLoading] = useState(true);

  const categories = [
    "Electronics", "Smartphones", "Laptops", "Watches", 
    "Audio & Headphones", "Gaming", "Cameras", "Accessories"
  ];

  useEffect(() => {
    fetchProducts();
  }, []);

  const fetchProducts = async () => {
    const { data, error } = await supabase.from('products').select('*').limit(10);
    if (!error) setProducts(data);
    setLoading(false);
  };

  return (
    <div style={pageContainer}>
      {/* 1. TOP NAV MENU */}
      <nav style={subNavBar}>
        <div style={navItemActive}>
           <ShoppingBag size={18} /> Shop by Category
        </div>
        <div style={navItem}>About us</div>
        <div style={navItem}>Business partnership</div>
        <div style={navItem}>Contact us</div>
      </nav>

      {/* 2. MAIN HERO SECTION */}
      <div style={heroGrid}>
        {/* SIDEBAR */}
        <aside style={sidebar}>
          {categories.map((cat, i) => (
            <div key={i} style={sidebarItem}>
              {cat} <ChevronRight size={14} color="#ccc" />
            </div>
          ))}
        </aside>

        {/* MAIN BANNER */}
        <div style={mainBanner}>
          <div style={bannerContent}>
            <h2 style={bannerTitle}>Wholesale Market</h2>
            <button style={bannerBtn}>GO SHOPPING <ChevronRight size={16} /></button>
          </div>
        </div>

        {/* PROFILE SECTION */}
        <div style={profileSection}>
          <div style={userHeader}>
            <div style={avatarCircle}><User size={24} color="#666" /></div>
            <p style={userGreeting}>Hi, Guest</p>
          </div>
          <div style={userActions}>
            <div style={actionIcon}>
              <CreditCard size={18} color={BRAND_BLUE} />
              <span style={iconLabel}>My Coupons</span>
            </div>
            <div style={actionIcon}>
              <Package size={18} color={BRAND_BLUE} />
              <span style={iconLabel}>My Orders</span>
            </div>
            <div style={actionIcon}>
              <MessageCircle size={18} color={BRAND_BLUE} />
              <span style={iconLabel}>Support</span>
            </div>
          </div>
          <div style={promoBox}>
            <p style={promoText}><strong>Great Value</strong><br/>Continuous promotions</p>
            <p style={promoText}><strong>Worldwide Delivery</strong><br/>Global shipping available</p>
          </div>
        </div>
      </div>

      {/* 3. PRODUCT SECTION */}
      <div style={sectionWrapper}>
        <h2 style={sectionTitle}>Featured Products</h2>
        {loading ? <p>Loading...</p> : (
          <div style={productGrid}>
            {products.map((product) => (
              <div key={product.id} style={productCard}>
                <div style={imgBox}><img src={product.image_url} alt="" style={prodImg} /></div>
                <div style={cardInfo}>
                  <p style={prodName}>{product.name}</p>
                  <p style={prodPrice}>RWF {product.price?.toLocaleString()}</p>
                  <button onClick={() => addToCart(product)} style={addBtn}>Add to Cart</button>
                </div>
              </div>
            ))}
          </div>
        )}
      </div>
    </div>
  );
};

// --- STYLES ---
const pageContainer = { backgroundColor: '#f5f5f5', minHeight: '100vh', width: '100%' };

const subNavBar = { 
  display: 'flex', gap: '30px', padding: '0 8%', 
  backgroundColor: '#fff', borderBottom: '1px solid #eee', height: '50px', alignItems: 'center' 
};

const navItemActive = { 
  backgroundColor: BRAND_BLUE, // Changed from Orange to Blue
  color: '#fff', height: '100%', 
  padding: '0 25px', display: 'flex', alignItems: 'center', gap: '10px', fontWeight: '700',
  borderTopLeftRadius: '4px', borderTopRightRadius: '4px'
};

const navItem = { color: '#333', fontSize: '14px', fontWeight: '500', cursor: 'pointer' };

const heroGrid = { 
  display: 'grid', gridTemplateColumns: '220px 1fr 240px', 
  gap: '15px', padding: '15px 8%', height: '420px', boxSizing: 'border-box' 
};

const sidebar = { backgroundColor: '#fff', padding: '10px 0', border: '1px solid #eee', borderRadius: '4px' };
const sidebarItem = { 
  padding: '10px 20px', fontSize: '13px', display: 'flex', 
  justifyContent: 'space-between', alignItems: 'center', cursor: 'pointer', borderBottom: '1px solid #f9f9f9'
};

const mainBanner = { 
  backgroundImage: 'url("https://images.unsplash.com/photo-1498050108023-c5249f4df085?auto=format&fit=crop&w=1200&q=80")', 
  backgroundSize: 'cover', backgroundPosition: 'center', position: 'relative', borderRadius: '4px' 
};

const bannerContent = { position: 'absolute', bottom: '40px', left: '40px', color: '#fff' };
const bannerTitle = { fontSize: '42px', fontWeight: '900', margin: '0 0 20px 0', textShadow: '0 2px 4px rgba(0,0,0,0.3)' };
const bannerBtn = { 
  backgroundColor: '#000', color: '#fff', border: 'none', padding: '12px 25px', 
  borderRadius: '30px', fontWeight: '700', cursor: 'pointer', display: 'flex', alignItems: 'center', gap: '5px' 
};

const profileSection = { backgroundColor: '#fff', padding: '20px', border: '1px solid #eee', borderRadius: '4px' };
const userHeader = { textAlign: 'center', marginBottom: '20px' };
const avatarCircle = { 
  width: '50px', height: '50px', borderRadius: '50%', backgroundColor: '#f0f0f0', 
  display: 'flex', alignItems: 'center', justifyContent: 'center', margin: '0 auto 10px' 
};
const userGreeting = { fontSize: '14px', fontWeight: '700', margin: 0 };

const userActions = { display: 'flex', justifyContent: 'space-around', marginBottom: '20px' };
const actionIcon = { textAlign: 'center', cursor: 'pointer' };
const iconLabel = { fontSize: '10px', display: 'block', marginTop: '5px', color: '#666' };

const promoBox = { borderTop: '1px solid #eee', paddingTop: '15px' };
const promoText = { fontSize: '11px', color: '#888', marginBottom: '10px' };

const sectionWrapper = { padding: '20px 8%' };
const sectionTitle = { fontSize: '20px', fontWeight: '700', marginBottom: '20px' };
const productGrid = { display: 'grid', gridTemplateColumns: 'repeat(5, 1fr)', gap: '15px' };

const productCard = { backgroundColor: '#fff', borderRadius: '4px', overflow: 'hidden', border: '1px solid #eee' };
const imgBox = { height: '180px', backgroundColor: '#fff', display: 'flex', alignItems: 'center', justifyContent: 'center' };
const prodImg = { maxWidth: '100%', maxHeight: '100%', objectFit: 'contain' };
const cardInfo = { padding: '12px', borderTop: '1px solid #f5f5f5' };
const prodName = { fontSize: '13px', margin: '0 0 8px 0', height: '36px', overflow: 'hidden', color: '#444' };
